SELECT COUNT(DISTINCT related_collections.Collection_ID) FROM (
  SELECT Collection_ID FROM Collection_Subset_Members WHERE Related_Collection_ID = (
    SELECT Collection_ID FROM Collections WHERE Collection_Name = 'Best'
  )
  UNION
  SELECT Related_Collection_ID AS Collection_ID FROM Collection_Subset_Members WHERE Collection_ID = (
    SELECT Collection_ID FROM Collections WHERE Collection_Name = 'Best'
  )
) AS related_collections
WHERE Collection_ID <> (SELECT Collection_ID FROM Collections WHERE Collection_Name = 'Best')
